});

jest.mock('./tts.js', () => {
  return { TTSModule: jest.fn().mockImplementation(() => ({
    speak: jest.fn(async (text, { onProgress, outputElement } = {}) => {
      if (onProgress) {
        onProgress({ percentage: 50, text: 'loading' });
        onProgress({ percentage: 100, text: 'ready' });
